// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract WasteManagement {
    struct Bin {
        uint256 id;
        string location;
        string state;
        uint256 capacity;
        uint256 currentWeight;
    }
    mapping(uint256 => Bin) public bins;
    uint256 public binsCount;

    address[] public shipperAddresses;
    address[] public citizenAddresses;
    address public owner;

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function createShipper(address _shipperAddress) external onlyOwner {
        shipperAddresses.push(_shipperAddress);
    }

    function deleteShipper(address _shipperAddress) external onlyOwner {
        for (uint256 i = 0; i < shipperAddresses.length; i++) {
            if (shipperAddresses[i] == _shipperAddress) {
                shipperAddresses[i] = shipperAddresses[
                    shipperAddresses.length - 1
                ];
                shipperAddresses.pop();
                break;
            }
        }
    }

    function createCitizen(address _citizenAddress) external onlyOwner {
        citizenAddresses.push(_citizenAddress);
    }

    function deleteCitizen(address _citizenAddress) external onlyOwner {
        for (uint256 i = 0; i < citizenAddresses.length; i++) {
            if (citizenAddresses[i] == _citizenAddress) {
                citizenAddresses[i] = citizenAddresses[
                    citizenAddresses.length - 1
                ];
                citizenAddresses.pop();
                break;
            }
        }
    }

    function createBin(uint256 _id,string memory _location,string memory _state,uint256 _capacity,uint256 _currentWeight) external onlyOwner {
        bins[_id] = Bin(_id, _location, _state, _capacity, _currentWeight);
        binsCount++;

    }

    function modifyBin(uint256 _id, string memory _location, string memory _state, uint256 _capacity, uint256 _currentWeight) external onlyOwner {
        bins[_id] = Bin(_id, _location, _state, _capacity, _currentWeight);
    }

    function deleteBin(uint256 _id) external onlyOwner {
    require(bins[_id].id != 0, "Bin does not exist");
    delete bins[_id];
    binsCount--;
}


    
    
    function getShipperAddresses() external view onlyOwner returns (address[] memory)
    {
        return shipperAddresses;
    }

    function getCitizenAddresses() external view onlyOwner returns (address[] memory)
    {
        return citizenAddresses;
    }


    function verifyCitizenByAddress(address _citizenAddress) external view returns (bool) {
        for (uint256 i = 0; i < citizenAddresses.length; i++) {
            if (citizenAddresses[i] == _citizenAddress) {
                return (true);
            }
        }
        return (false);
    }

    function verifyShipperByAddress(address _shipperAddress) external view returns (bool) {
        for (uint256 i = 0; i < shipperAddresses.length; i++) {
            if (shipperAddresses[i] == _shipperAddress) {
                return (true);
            }
        }
        return (false);
    }

    function getBinById(uint256 _id) external view returns (uint256, string memory, string memory, uint256, uint256) {
        Bin memory bin = bins[_id];
        if (bin.id == 0) {
            return (0, "", "", 0, 0);
        } else {
            return (bin.id, bin.location, bin.state, bin.capacity, bin.currentWeight);
        }
    }
    
   //get all bins lezm nzidouha ama fiha machekel 5aterha fi map w display mte3ha maset
 
 


}
